import React, { Component } from 'react'
import Table from '@material-ui/core/Table';
import TableHead from '@material-ui/core/TableHead';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Asset from './Asset';
import classes from '*.module.css';

const AssetData = [
  {
    'nations':'미국',
    'assetclass':'국채 단기물(1~3년)',
    'period':'10년',
    'CAGR':'1.23%'
  }
]

class CreateTable extends Component {
  render() {
    return(
      <Paper>
        <Table calssName={classes.table} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>국가</TableCell>
              <TableCell allign="right">종목</TableCell>
              <TableCell allign="right">기간</TableCell>
              <TableCell>수익률</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            <TableRow>
              {AssetData.map(c=>{
                return <Asset key={c.nations} nations={c.nations} assetclass={c.assetclass} period={c.period} CAGR={c.CAGR} />
              })}
            </TableRow>               
          </TableBody>
        </Table>
      </Paper>
    )
  }
}

export default CreateTable;
